# This script reads temperature value and image data from Serial and saves them to a .jpg and csv file.
# The .jpg file is numerically numbered and for each image, their is a corresponding temperature value that is recorded.
# Note that the image is sent as base64 encoded data. The script uses base64, numpy and pillow to process this data.

# Developed by: Solomon Muhunyo Githu, 12th July 2024.

import os
import serial
import base64
import csv
from PIL import Image
import numpy as np
from time import sleep

# Configure the serial port and baud rate (adjust as needed)
SERIAL_PORT = 'COM3'    # Replace with your actual serial port
BAUD_RATE = 115200      # Needs to be the same baud rate as the Arduino board!

# Use the same image width and height (pixels) settings as in the Arduino code!
image_width = 240
image_height = 240

# Define filepaths
dataset_folder = "fire_detection_sensor_fusion_dataset"
current_dataCount = 1
# note that the script will automatically split the data for training and testing
number_of_samples_to_collect = 60 
#number_of_samples_to_collect = 10
dataset_class = "safe_environment"
#dataset_class = "fire"
#dataset_class = "safe_environment_test"
#dataset_class = "fire_test"
save_to_directory = dataset_folder + '/' + dataset_class
csv_filename = save_to_directory + '/' + dataset_class + '.csv'

# Initialize the serial connection
try:
    ser = serial.Serial(SERIAL_PORT, BAUD_RATE, timeout=1)
    print(f"Connected to {SERIAL_PORT} at {BAUD_RATE} baud rate.")
except serial.SerialException as e:
    print(f"Failed to connect to {SERIAL_PORT}: {e}")
    exit()

# Function to read the Serial data, process it and get the temperature and image data
def read_image_and_temperature():
    image_data = ''
    temperature = None
    
    while True:
        try:
            line = ser.readline().decode('utf-8').strip()
            #if line:
                #print(f"Received line: {line}")  # Debugging print statement
            if line.startswith("Current temperature ="):
                temperature = float(line.split('=')[1].strip())
                print(f"Temperature received: {temperature}")
            if line.startswith("Image data ="):
                image_data = line.split('=')[1].strip()
            elif line.startswith("===================== END ========================"):
                break
        except Exception as e:
            print(f"Error reading from serial port: {e}")
            break

    return image_data, temperature

# Function to decode the base64 image data and save is as a JPG
def save_image(image_data, filename):
    found_invalid_snapshot = False

    # Parse as base64
    decoded_data = base64.b64decode(image_data)
    snapshot = np.frombuffer(decoded_data, dtype=np.uint8)
    expected_size_single_channel = image_width * image_height
    expected_size_three_channels = image_width * image_height * 3
    
    if snapshot.size == expected_size_single_channel:
        snapshot = np.repeat(snapshot[:, np.newaxis], 3, axis=1).reshape((image_height, image_width, 3))
    elif snapshot.size == expected_size_three_channels:
        snapshot = snapshot.reshape((image_height, image_width, 3))
    else:
        print("Invalid snapshot size. Expected %s or %s, but got %s", expected_size_single_channel, expected_size_three_channels, snapshot.size)
        found_invalid_snapshot = True
        """
        raise ValueError(f'Invalid snapshot size. Expected {expected_size_single_channel} or {expected_size_three_channels}, but got {snapshot.size}')
        """
        
    # Create an image from the numpy array
    try:
        image = Image.fromarray(snapshot)
        # Verify the image object creation
        print(f'Image object created: {image}')
    except Exception as e:
        print(f"Error creating image: {e}")
        exit(1)
    
    # Save the image
    try:
        if not found_invalid_snapshot:
            image.save(filename)
            print(f"Image saved as {filename}")
    except Exception as e:
        print(f"Error saving image: {e}")
        exit(1)
    
# Function to save the temperature value in a CSV file
def save_temperature(index, temperature, label, csv_filename):
    if label == 'fire_test':
        label = 'fire'
    elif label == 'safe_environment_test':
        label = 'safe_environment'
    try:
        with open(csv_filename, 'a', newline='') as csvfile:
            csvwriter = csv.writer(csvfile)
            csvwriter.writerow([index, temperature, label])
        print(f"Temperature {temperature} saved to {csv_filename} with index {index}")
    except Exception as e:
        print(f"Failed to save temperature: {e}")
        pass


def main():
    dataCount = 1

    # check if the dataset folder exists
    if not os.path.exists(dataset_folder):
      os.makedirs(dataset_folder)
    # check if the class parent folder exists
    if not os.path.exists(dataset_folder + '/' + dataset_class):
      os.makedirs(dataset_folder + '/' + dataset_class)

    # create the column headers for the csv file
    with open(csv_filename, 'a', newline='') as csvfile:
            csvwriter = csv.writer(csvfile)
            csvwriter.writerow(['filename', 'temperature', 'label'])

    while True:
        # record a number of samples
        if (dataCount - 1 ) != number_of_samples_to_collect:
            print("Waiting for Serial data...")
            image_data, temperature = read_image_and_temperature()
            print("temperature =", temperature)
            print("image_data =", image_data)

            # Ensure that both temperature and image data have been captured
            # This way the script automatically saves data when it has started reading data at the same time as the Arduino sent it! (Easy hack)
            if image_data and temperature is not None:
                print(f"Saving temperature and image...")
                image_filename = os.path.join(save_to_directory, f'{dataCount}.jpg')
                save_image(image_data, image_filename)
                save_temperature(dataCount, temperature, dataset_class, csv_filename)
                print("========== Data saved successfully. ========== ")
                dataCount += 1 # Increment the data count
            else:
                print("========== No image or temperature data received! ==========")

            sleep(1.5)  # Adding delay to match the Arduino code
        
        else:
            print("Finished saving ", number_of_samples_to_collect, " samples!")

if __name__ == '__main__':
    main()


